import React from 'react';
import { useNavigate } from 'react-router-dom';

const HomePage = () => {
    const navigate = useNavigate();
  
    const handleLoginClick = () => {
      navigate('/loginpage'); 
    };
const HomePage = () => {
  return (
    <div style={{ backgroundColor: 'lightgreen', minHeight: '100vh' }}>
      <center>
        <h1>E-farming</h1>
        <h3>
          <a href="info.html">Information</a>&nbsp;&nbsp;&nbsp;
          <a href="about.html">About us</a>&nbsp;&nbsp;&nbsp;
          <a href="contact.html">Contact us</a>
        </h3>
        <br />
        <img src="Homepage.jpg" alt="Homepage" height="400px" width="400px" />
        <br /><br />
        <button onClick={handleLoginClick} style={{ padding: '10px', borderRadius: '10px' }}>
        Go to Login
      </button>
        <br /><br />
        <img src="hompage2.jpg" alt="Homepage 2" height="400px" width="400px" />
      </center>
    </div>
  );
};};
export default HomePage;
